                            Date = new DateTime(2021, 1, 21, 22, 48, 44, 115, DateTimeKind.Local).AddTicks(6407),
                            Description = "<p><strong>Playdead</strong> — датская студия, разработавшая мрачные пазл-платформеры <strong>Limbo</strong> и <strong>Inside</strong>. В настоящее время компания трудится над новой игрой, но делает это столь неспешно, что на протяжении последних лет фанатам остаётся лишь прочёсывать <a target=\"_blank\" href=\" / to /? https ://playdead.com/jobs\">список вакансий</a> в поисках подробностей. Недавно там заметили два свежих арта.</p><p>О проекте известно совсем мало:</p><ul><li> Это научно - фантастическое приключение с видом от третьего лица.</li><li> Заявлен открытый мир.</li><li> Движок — Unreal Engine.</li><li> Издателем выступает <strong> Epic Games </strong>.</li><li> Развлечение создают для нескольких платформ, но для каких именно — загадка.</li></ul><p> На сайте <strong> Playdead </strong> упомянуто, что её коллектив насчитывает 50 специалистов.Неясно, все ли они занимаются одной игрой.</p><p> Сроки релиза датчане ещё не обозначили.</p><p> В галерее ниже можно посмотреть все найденные иллюстрации к игре.Первые две картинки — новые.</p>",
