                            Date = new DateTime(2021, 1, 21, 22, 48, 44, 115, DateTimeKind.Local).AddTicks(7390),
                            Description = "<p>Восьмой сезон <strong>Apex Legends</strong>, <strong>«Переполох»</strong>, начнётся уже 2 февраля. В преддверии скорого выхода апдейта состоялась премьера кинематографичного трейлера.</p><p>Напомним список грядущих добавок:</p><ul><li> Новая легенда — Фьюз.</li><li> Переработанная карта «Каньон Кингс». Сегодняшний ролик раскрывает предысторию изменений.</li><li> Винтовка рычажного действия 30 - 30.</li><li> Боевой пропуск сезона — свыше 100 предметов,  в том числе легендарные скины, наборы Apex и голоспреи.</li><li> Очередной рейтинговый сезон.</li></ul><p></p> ",
