                            Description = "<p>На прошлой неделе <strong>Capcom</strong> <a href=\"https://stopgame.ru/newsdata/46369\">объявила</a> о грядущем бета-тестировании сетевой игры по <strong>Resident Evil</strong>. Некоторые пользователи предположили, что это многопользовательский придаток <strong>RE Village</strong> — что-то вроде <strong>Resistance</strong> для прошлогодней <strong>RE3</strong>. По-видимому, эта догадка верна.</p><p>В Humble Store обнаружились страницы <a target=\"_blank\" href=\"/to/?https://www.humblebundle.com/store/resident-evil-village\">стандартного</a> и <a target=\"_blank\" href=\"/to/?https://www.humblebundle.com/store/resident-evil-village-deluxe-edition?hmb_source=search_bar\">Deluxe</a>-изданий <strong>Village</strong>. В описании товаров сказано, что они содержат основную игру и таинственную <strong>Resident Evil Re:Verse</strong> — это, вероятно, и есть мультиплеер. В пользу данной версии говорит то, что недавно у «Деревни» обновилась запись в <a target=\"_blank\" href=\"/to/?https://steamdb.info/app/1196590/history/?changeid=10506054\">базе данных Steam</a> — там появилась отметка о многопользовательском режиме.</p><p><strong>Capcom</strong> говорила, что неанонсированное сетевое развлечение рассчитано на 4—6 участников. ЗБТ новинки пройдёт с 28-го по 31 января.</p><p></p><div id=\"player_a81e709baed624f19e8ad19a18ff1e0e\" class=\"video-wrapper\" style=\"padding: 0px; word-spacing: normal; position: relative; box-sizing: content-box !important; text-align: left; user-select: none; overflow: hidden; font-family: sans-serif; min-height: 15px; font-size: 14px; line-height: 1em; direction: ltr; height: 511.875px;\"><pjsdiv id=\"oframeplayer_a81e709baed624f19e8ad19a18ff1e0e\" style=\"position: absolute; box-sizing: content-box !important; background-color: rgb(0, 0, 0); color: rgb(255, 255, 255); width: 100%; height: 100%; left: 0px; top: 0px; font-size: 14px; line-height: 1em; cursor: default;\"><style type=\"text/css\">pjsdiv