ar player = new Playerjs({id:\"player_a81e709baed624f19e8ad19a18ff1e0e\", file:\"https://www.youtube.com/watch?v=LG-u73YG9xw\", preroll: \"https://stopgame.ru/bans/preroll\", poster: \"https://img.youtube.com/vi/LG-u73YG9xw/maxresdefault.jpg\"});});</script><p></p><p>Ещё одна любопытная деталь — «бета» онлайн-проекта будет доступна на обоих поколениях PlayStation и Xbox. Если это действительно часть <strong>Village</strong>, значит, последняя навестит и пастген. Ранее она была заявлена только для PC и свежих консолей, хоть разработчики и <a href=\"https://stopgame.ru/newsdata/44961\">утверждали</a>, что не прочь перенести ужастик на PlayStation 4 и Xbox One.</p><p>Кроме того, страница в Humble Store раскрыла состав Deluxe-издания <strong>Village</strong> — в него входят основная игра, <strong>Re:Verse</strong> и полевой набор. Тот включает в себя оружие Samurai Edge, аксессуар Mr. Everywhere, экранный фильтр, особую фоновую музыку для безопасной комнаты и «многие другие предметы, которые помогут усилить впечатление от игры».</p><p>Наконец, перечислены бонусы за предзаказ «Деревни» — украшение мистера Енота, набор для выживания и мини-саундтрек игры.</p><p>Уже скоро, в ночь с 21-го на 22 января, <strong>Capcom</strong> покажет трейлер и геймплей <strong>Resident Evil Village</strong>, а также сообщит другие новости о своей хоррор-серии. Если не хотите ничего пропустить, то в 01:00 по Москве заходите на <a target=\"_blank\" href=\"/to/?https://www.twitch.tv/capcomusa\">Twitch</a> и <a target=\"_blank\" href=\"/to/?https://www.youtube.com/user/ResidentEvil\">YouTube</a>.</p>",
                            MainPhoto = "https://www.residentevil.com/village/assets/images/common/share.png",
