                            Id = 4,
                            Date = new DateTime(2021, 1, 21, 22, 48, 44, 115, DateTimeKind.Local).AddTicks(7402),
                            Description = "<p>В Epic Games Store обновилась еженедельная раздача. Сегодня ветер халявы принёс в магазин 4X-стратегию <strong>Galactic Civilizations III</strong> — забирайте её <a target=\"_blank\" href=\"/to/?https://www.epicgames.com/store/ru/product/galactic-civilizations-iii/home#editions\">по ссылке</a>.</p><p>Игра предлагает вам создать собственную цивилизацию и бороться за господство в космосе. Набор занятий стандартный для жанра — исследуйте технологии, разрабатывайте космические корабли, подписывайте дипломатические соглашения, торгуйте, развязывайте войны и шпионьте за врагами. Каждую партию можно настраивать, регулируя разнообразные параметры. Есть онлайн-мультиплеер.</p><p>Творение <strong>Stardock Entertainment</strong> собрало приличные оценки — 83/100 на <a target=\"_blank\" href=\"/to/?https://opencritic.com/game/1252/galactic-civilizations-iii/reviews\">OpenCritic</a> и в основном положительные рецензии в <a target=\"_blank\" href=\"/to/?https://store.steampowered.com/app/226860/Galactic_Civilizations_III/\">Steam</a>. Судя по отзывам, у игры крепкий геймплейный скелет, но мясо для него надо покупать отдельно — <strong>GCIII</strong> получила тучу дополнений, и без некоторых DLC искушённым стратегам будет скучновато.</p><p><strong>Galactic Civilizations III</strong> пробудет бесплатной до 28 января, 19:00 по московскому времени. Следующий подарок — метроидвания <strong>Dandara: Trials of Fear Edition</strong>.</p><p></p><div id=\"player_8f0125da7891e18a68123434bd7d5e0e\" class=\"video-wrapper\" style=\"padding: 0px; word-spacing: normal; position: relative; box-sizing: content-box !important; text-align: left; user-select: none; overflow: hidden; font-family: sans-serif; min-height: 15px; font-size: 14px; line-height: 1em; direction: ltr; height: 511.875px;\"><pjsdiv id=\"oframeplayer_8f0125da7891e18a68123434bd7d5e0e\" style=\"position: absolute; box-sizing: content-box !important; background-color: rgb(0, 0, 0); color